-- ----------------------------
--  Table structure for `sys_log`
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `type` char(1) COLLATE utf8_bin DEFAULT '1' COMMENT '',
  `title` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `create_date` datetime DEFAULT NULL COMMENT '',
  `remote_addr` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'IP',
  `user_agent` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `request_uri` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'URI',
  `method` varchar(5) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `params` text COLLATE utf8_bin COMMENT '',
  `exception` text COLLATE utf8_bin COMMENT '',
  PRIMARY KEY (`id`),
  KEY `sys_log_create_by` (`create_by`),
  KEY `sys_log_request_uri` (`request_uri`),
  KEY `sys_log_type` (`type`),
  KEY `sys_log_create_date` (`create_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='';

